import React, { useState } from 'react';
import styled from 'styled-components';
import COLORS from '../../styles/colors'
import { FONT_STYLES } from '../../styles/font-style';

import IcLocation from '../../assets/ic-location.png';
import IcAlarm from '../../assets/ic-alarm.png';
import IcSettings from '../../assets/ic-settings.png';


  const Styled = {
    Wrap: styled.div`
      // display: flex;
      // flex-direction: column;
    `,
    System: styled.div`
      width: 100%;
      height: 44px;
      background-color: ${COLORS.Gray100};
      ${FONT_STYLES.R_12}
    `,
    Header: styled.div`
      height: 52px;
      background-color: ${COLORS.Gray200};
      display: flex;
      // justify-contents: center;
      // margin: 18px 20px;
      align-item: center;
    `,
    RightIconWrap: styled.div`
      display: flex;
      background-color: red;
    `,
  }

  const Icon = {
    Location: styled.img`
      width: 16px;
      height: 16px;
      margin: 18px 20px;
      
    `,
    Alarm: styled.img`
      width: 16px;
      height: 16px;
      margin: 18px 5.5px;
    `,
    Settings: styled.img`
      width: 16px;
      height: 16px;
      margin: 18px 5.5px;
    `
  }


function Home() {
  return (
    <div>
      <Styled.System />
      <Styled.Header>
        <Icon.Location src={IcLocation} />
        <Styled.RightIconWrap>
          <Icon.Alarm src={IcAlarm} />
          <Icon.Settings src={IcSettings} />
        </Styled.RightIconWrap>
      </Styled.Header>
    </div>
  )
}

export default Home
